import React from 'react'
import BlogItem from './BlogItem'
import './BlogList.css'

const BlogList = () => (
    <div className='bloglistwrap'>
        {blog.map((blog) =>
        (<BlogItem blog={blog}
            key={blog.id} />
        ))}
    </div>
);

export default BlogList
